static const char __pyx_k_Implements_a_WebSocket_for_Disco[] = "Implements a WebSocket for Discord's gateway v6.\n\n    This is created through :func:`create_main_websocket`. Library\n    users should never create this manually.\n\n    Attributes\n    -----------\n    DISPATCH\n        Receive only. Denotes an event to be sent to Discord, such as READY.\n    HEARTBEAT\n        When received tells Discord to keep the connection alive.\n        When sent asks if your connection is currently alive.\n    IDENTIFY\n        Send only. Starts a new session.\n    PRESENCE\n        Send only. Updates your presence.\n    VOICE_STATE\n        Send only. Starts a new connection to a voice server.\n    VOICE_PING\n        Send only. Checks ping time to a voice server, do not use.\n    RESUME\n        Send only. Resumes an existing connection.\n    RECONNECT\n        Receive only. Tells the client to reconnect to a new gateway.\n    REQUEST_MEMBERS\n        Send only. Asks for the full member list of a server.\n    INVALIDATE_SESSION\n        Receive only. Tells the client to invalidate the session and IDENTIFY\n        again.\n    HELLO\n        Receive only. Tells the client the heartbeat interval.\n    HEARTBEAT_ACK\n        Receive only. Confirms receiving of a heartbeat. Not having it implies\n        a connection issue.\n    GUILD_SYNC\n        Send only. Requests a guild sync.\n    gateway\n        The gateway we are currently connected to.\n    token\n        The authentication token for discord.\n    ";
static const char __pyx_k_Implements_the_websocket_protoco[] = "Implements the websocket protocol for handling voice connections.\n\n    Attributes\n    -----------\n    IDENTIFY\n        Send only. Starts a new voice session.\n    SELECT_PROTOCOL\n        Send only. Tells discord what encryption mode and how to connect for voice.\n    READY\n        Receive only. Tells the websocket that the initial connection has completed.\n    HEARTBEAT\n        Send only. Keeps your websocket connection alive.\n    SESSION_DESCRIPTION\n        Receive only. Gives you the secret key required for voice.\n    SPEAKING\n        Send only. Notifies the client if you are currently speaking.\n    ";
